If &gDiffOffsetTAO Then
   FS_ALLC_GEN_AET.RECNAME = FS_ALLC_STP_AET.RECNAME_OFFSET_TAO;
Else
   FS_ALLC_GEN_AET.RECNAME = FS_ALLC_STP_AET.RECNAME_ALLOC_WRK;
